var Hoverstrip = (function () {
  return {
    init: function () {
      setTimeout(function () {
        Hoverstrip.build();
      }, 1000);
      this.events();
    },
    build: function () {
      var box = $(".hoverstrip-box");
      box.each(function () {
        $(this).append('<div class="hoverstrip-strip">');
      });
    },
    activate: function (item) {
      var box = item.closest(".hoverstrip-box");
      var pos = Hoverstrip.position(item);
      var strip = box.find(".hoverstrip-strip");
      strip.css({ left: pos.left + "px", right: pos.right + "px" });
    },
    position: function (item) {
      var box = item.closest(".hoverstrip-box");
      var coords = {};
      coords.left =
        item.position().left +
        parseInt(item.css("margin-left")) +
        parseInt(item.css("padding-left"));
      coords.right = box.outerWidth() - coords.left - item.width();
      return coords;
    },
    getActive: function (item) {
      return item.closest(".hoverstrip-box").find("._active");
    },
    clear: function (item) {
      var box = item.closest(".hoverstrip-box");
      var strip = box.find(".hoverstrip-strip");
      var pos = Hoverstrip.position(item);
      var right = box.outerWidth() - pos.left + 1;
      strip.css({ left: pos.left + "px", right: right + "px" });
    },
    hover: function (item) {
      var box = item.closest(".hoverstrip-box");
      var strip = box.find(".hoverstrip-strip");
      var hoverPos = Hoverstrip.position(item);
      var currentPosLeft = parseInt(strip.css("left"));
      var currentPosRight = parseInt(strip.css("right"));
      if (hoverPos.left > currentPosLeft) {
        strip.css("right", hoverPos.right);
        setTimeout(function () {
          strip.css("left", hoverPos.left);
        }, 200);
      } else {
        strip.css("left", hoverPos.left);
        setTimeout(function () {
          strip.css("right", hoverPos.right);
        }, 200);
      }
    },
    events: function () {
      $(document)
        .on("mouseover", ".hoverstrip-item", function () {
          Hoverstrip.hover($(this));
        })
        .on("mouseout", ".hoverstrip-item", function (e) {
          Hoverstrip.clear($(this));
        });
    },
  };
})();
